{
  "$schema": "./node_modules/@angular/cli/lib/config/schema.json",
  "version": 1,
  "cli": {
    "packageManager": "npm",
    "schematicCollections": [
      "@o3r/core",
      "@ama-sdk/schematics",
      "@o3r/workspace",
      "@schematics/angular"
    ],
    "analytics": false
  },
  "newProjectRoot": "projects",
  "projects": {
    "tuto": {
      "projectType": "application",
      "schematics": {
        "@schematics/angular:component": {
          "style": "scss"
        },
        "@o3r/core:component": {
          "path": "apps/tuto/src/components",
          "description": "",
          "useContext": false,
          "skipLinter": true
        },
        "@o3r/core:page": {
          "path": "apps/tuto/src/app"
        },
        "@o3r/core:service": {
          "path": "apps/tuto/src/services"
        },
        "@o3r/core:store": {
          "path": "apps/tuto/src/store"
        },
        "@o3r/core:schematics-update": {
          "path": "apps/tuto/src/schematics"
        },
        "@o3r/testing:playwright-scenario": {
          "path": "apps/tuto/e2e-playwright/scenarios"
        },
        "@o3r/testing:playwright-sanity": {
          "path": "apps/tuto/e2e-playwright/sanity"
        }
      },
      "root": "apps/tuto",
      "sourceRoot": "apps/tuto/src",
      "prefix": "app",
      "architect": {
        "build": {
          "builder": "@angular-devkit/build-angular:browser",
          "options": {
            "outputPath": "dist/tuto",
            "index": "apps/tuto/src/index.html",
            "main": "apps/tuto/src/main.ts",
            "polyfills": [
              "zone.js"
            ],
            "tsConfig": "apps/tuto/tsconfig.app.json",
            "inlineStyleLanguage": "scss",
            "assets": [
              "apps/tuto/src/favicon.ico",
              "apps/tuto/src/assets"
            ],
            "styles": [
              "apps/tuto/src/styles.scss"
            ],
            "scripts": []
          },
          "configurations": {
            "production": {
              "budgets": [
                {
                  "type": "initial",
                  "maximumWarning": "500kb",
                  "maximumError": "1mb"
                },
                {
                  "type": "anyComponentStyle",
                  "maximumWarning": "2kb",
                  "maximumError": "4kb"
                }
              ],
              "outputHashing": "all",
              "outputPath": "apps/tuto/dist"
            },
            "development": {
              "buildOptimizer": false,
              "optimization": false,
              "vendorChunk": true,
              "extractLicenses": false,
              "sourceMap": true,
              "namedChunks": true,
              "fileReplacements": [
                {
                  "replace": "apps/tuto/src/environments/environment.ts",
                  "with": "apps/tuto/src/environments/environment.development.ts"
                }
              ]
            }
          },
          "defaultConfiguration": "production"
        },
        "serve": {
          "builder": "@angular-devkit/build-angular:dev-server",
          "configurations": {
            "production": {
              "browserTarget": "tuto:build:production"
            },
            "development": {
              "browserTarget": "tuto:build:development"
            }
          },
          "defaultConfiguration": "development"
        },
        "extract-i18n": {
          "builder": "@angular-devkit/build-angular:extract-i18n",
          "options": {
            "browserTarget": "tuto:build"
          }
        },
        "test": {
          "builder": "@angular-devkit/build-angular:karma",
          "options": {
            "polyfills": [
              "zone.js",
              "zone.js/testing"
            ],
            "tsConfig": "apps/tuto/tsconfig.spec.json",
            "inlineStyleLanguage": "scss",
            "assets": [
              "apps/tuto/src/favicon.ico",
              "apps/tuto/src/assets"
            ],
            "styles": [
              "apps/tuto/src/styles.scss"
            ],
            "scripts": []
          }
        }
      }
    }
  },
  "schematics": {
    "*:ng-add": {
      "registerDevtool": true
    },
    "*:*": {
      "libsDir": "libs",
      "appsDir": "apps"
    }
  }
}

 * * * * * * to get started with your project! * * * * * * * * -->
