<style>
  :host {
    font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif, "Apple Color Emoji", "Segoe<!-- * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * -->
